import React from "react";
import ContactForm from "./form";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/contact" element={<ContactForm />} />
            </Routes>
        </Router>
    );
};

export default App;
